import { useState, useEffect } from 'react';
import { supabase } from '../supabaseClient';

function Clasificacion() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    async function fetchUsers() {
      let { data, error } = await supabase.from('users').select('*').order('puntuacion', { ascending: false });
      if (error) console.log('Error:', error);
      else setUsers(data);
    }
    fetchUsers();
  }, []);

  return (
    <div>
      <h2>Clasificación</h2>
      <table>
        <thead>
          <tr>
            <th>Username</th>
            <th>Puntuación</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.username}</td>
              <td>{user.puntuacion}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Clasificacion;
